import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';

function NavMenu() {
  return (
    <Container className="d-flex align-items-center py-5">
      {/* Logo */}
      <img src="/images/actual-logo.png" alt="Site Logo" width="100" />

      {/* Buttons filling the remaining space */}
      <div className="d-flex flex-grow-1 gap-4 ms-4">
        <Button variant="outline-success" size="lg" className="w-50 py-3">
          Coding
        </Button>
        <Button variant="outline-info" size="lg" className="w-50 py-3">
          Comics
        </Button>
      </div>
    </Container>
  );
}

export default NavMenu;
